GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_04"] = [[$16020244]] -- - They can wipe hordes of daemonic fiends with their Cleansing Fire ability.
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_05"] = [[$16020245]] -- - Equipped with Empyrean Brain Mines that directly assault the minds of nearby infantry.
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_06"] = [[$16020246]] -- - All squad members can upgrade either their ranged or melee weapons, to improved versions.
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_07"] = [[$16020247]] -- - Effective against Infantry and Heavy Infantry.
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_08"] = [[$16020248]] -- - NOTE: Recruitment cost is higher that reinforcement cost, for all Grey Knights squads!
